export const ProductsData = {
    '123456': {
        name: "Bread",
        price: 5,
        quantity:0,
    }, 
    '987654': {
        name: "Milk",
        price: 4,
        quantity:0,
    },
    '852741': {
        name: "White-cheese",
        price: 10,
        quantity:0,
    },
    '3574219': {
        name: "Wafels",
        price: 8.5,
        quantity:0,
    },
    '8495172': {
        name: "Chocolate",
        price: 7,
        quantity:0,
    },
}

export const getData = (code) => ProductsData[code];
export const getAllProducts = () => ProductsData;
export const codes = Object.keys(ProductsData);
